    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from May through August
    of 1959. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds and fish-
    is also covered. Resource management is outlined; topics include grazing. The public
    relations section of the report describes Refuge visitors. Items of interest and
